import React, { Component } from 'react'
import { getContact } from '../../../host/config'

export default class Call extends Component {
state={
data:[]
}
getContacts=()=>{
    getContact().then(res=>{
        this.setState({data:res.data})
        console.log(res.data)
    })
}
componentDidMount(){
    this.getContacts()
}
  render() {
    return (
      <div></div>
    )
  }
}
